class Solution {
  int continuousSubarrays(List<int> nums) {
    int count = 0;
    int start = 0;
    List<int> minDeque = [], maxDeque = [];
    for (int end = 0; end < nums.length; end++) {
      while (minDeque.isNotEmpty && nums[minDeque.last] > nums[end]) {
        minDeque.removeLast();
      }
      while (maxDeque.isNotEmpty && nums[maxDeque.last] < nums[end]) {
        maxDeque.removeLast();
      }
      minDeque.add(end);
      maxDeque.add(end);

      while (nums[maxDeque.first] - nums[minDeque.first] > 2) {
        if (minDeque.first == start) minDeque.removeAt(0);
        if (maxDeque.first == start) maxDeque.removeAt(0);
        start++;
      }

      count += end - start + 1;
    }
    return count;
  }
}
